import React from 'react';
import './App.css';
import lottie from 'lottie-web';
import xmasAnim from './xmas_anim.json';
import catAnim from './cat_anim.json';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Day from './Component/day.js';


class App extends React.Component {
  render() {
    const daysUntilChristmas = 24;
    const calendar = [];

    for (let day = 1; day <= daysUntilChristmas; day++) {
      calendar.push(
        <div 
          key={day} 
          className={`calendar-square bg-image${day}`}>
          {day}
        </div>
      );
    }

    const numSnowflakes = 50;
    const snowflakeContainer = document.querySelector('.snowflake-container');

    for (let i = 0; i < numSnowflakes; i++) {
      const snowflake = document.createElement('div');
      snowflake.className = 'snowflake';
      snowflake.style.left = `${Math.random() * 100}%`;
      snowflake.style.animationDuration = `${Math.random() * 10 + 5}s`;
      snowflakeContainer.appendChild(snowflake);
    }

    return (
      <div className="app">
        <h1 className='title'>Torsguttas gledelige jul</h1>
        <Router>
          <Switch>
            <Route path="/day" component={Day} />
          </Switch>
        </Router>
        <div className="calendar-container">{calendar}</div>
        <Routing />
        <div
          className="xmas-anim"
          ref={(ref) => (this.santaAnimationContainer = ref)}
        ></div>
        <div
          className="cat-anim"
          ref={(ref) => (this.catAnimationContainer = ref)}
        ></div>
      </div>

      );

    function Routing() {
      return (
        <Router>
          <Switch>
            <Route path="/day1" component={Day1} />
            <Route path="/day2" component={Day2} />
            <Route path="/day3" component={Day3} />
            <Route path="/day4" component={Day4} />
            <Route path="/day5" component={Day5} />
            <Route path="/day6" component={Day6} />
            <Route path="/day7" component={Day7} />
            <Route path="/day8" component={Day8} />
            <Route path="/day9" component={Day9} />
            <Route path="/day10" component={Day10} />
            <Route path="/day11" component={Day11} />
            <Route path="/day12" component={Day12} />
            <Route path="/day13" component={Day13} />
            <Route path="/day14" component={Day14} />
            <Route path="/day15" component={Day15} />
            <Route path="/day16" component={Day16} />
            <Route path="/day17" component={Day17} />
            <Route path="/day18" component={Day18} />
            <Route path="/day19" component={Day19} />
            <Route path="/day20" component={Day20} />
            <Route path="/day21" component={Day21} />
            <Route path="/day22" component={Day22} />
            <Route path="/day23" component={Day23} />
            <Route path="/day24" component={Day24} />
          </Switch>
        </Router>
      );
    }
  }

  constructor(props) {
    super(props);
    this.animationLoaded = false; // Track whether animation is loaded
  }

  componentDidMount() {
    if (!this.animationLoaded) {
      lottie.loadAnimation({
        container: this.santaAnimationContainer,
        renderer: 'svg',
        loop: true,
        autoplay: true,
        animationData: xmasAnim,
      });

      lottie.loadAnimation({
        container: this.catAnimationContainer,
        renderer: 'svg',
        loop: true,
        autoplay: true,
        animationData: catAnim,
      });
      this.animationLoaded = true; // Mark animation as loaded
    }
  }
}



export default App;
